//INITIAL DUMMY DATA

export default function() {
  return [
    {
      id: 0,
      due: "no due date",
      text: "belajar react",
      status: "N"
    },
    {
      id: 1,
      due: "no due date",
      text: "belajar redux",
      status: "Y"
    },
    {
      id: 2,
      due: "2019-03-22",
      text: "belajar maleo",
      status: "N"
    }
  ];
}
